import React from 'react';
import { Helmet } from 'react-helmet';
import ProjectCard from './components/ProjectCard';
import Resume from './components/Resume';
import ContactForm from './components/ContactForm';
import './App.css';

function App() {
  const projects = [
    { title: 'Project 1', description: 'A brief description of project 1.', link: 'https://example.com' },
    { title: 'Project 2', description: 'A brief description of project 2.', link: 'https://example.com' },
  ];

  return (
    <div className="App">
      <Helmet>
        <title>[Your Name] | Personal Portfolio</title>
        <meta name="description" content="Personal portfolio of [Your Name], showcasing skills, projects, and achievements as a [Your Profession]." />
        <meta name="keywords" content="portfolio, [Your Name], [Your Profession], projects, skills, resume, contact" />
        <meta name="author" content="[Your Name]" />
        <meta name="robots" content="index, follow" />
        <meta property="og:title" content="[Your Name] | Personal Portfolio" />
        <meta property="og:description" content="Explore the portfolio of [Your Name], a [Your Profession] showcasing skills, projects, and achievements." />
        <meta property="og:type" content="website" />
        <meta property="og:url" content="https://yourwebsite.com" /> {/* Replace with your deployed URL */}
        <meta property="og:image" content="https://yourwebsite.com/og-image.jpg" /> {/* Add an image in your public folder */}
      </Helmet>
      <header>
        <h1>My Portfolio</h1>
        <nav>
          <a href="#home">Home</a>
          <a href="#about">About</a>
          <a href="#portfolio">Portfolio</a>
          <a href="#resume">Resume</a>
          <a href="#contact">Contact</a>
        </nav>
      </header>
      <main>
        <section id="home">
          <h2>Welcome to My Portfolio</h2>
          <p>Hi, I'm [Your Name], a [Your Profession]. Explore my work below!</p>
        </section>
        <section id="about">
          <h2>About Me</h2>
          <p>Write about your background, skills, and achievements here.</p>
        </section>
        <section id="portfolio">
          <h2>My Projects</h2>
          <div style={{ display: 'flex', justifyContent: 'center', flexWrap: 'wrap' }}>
            {projects.map((project, index) => (
              <ProjectCard
                key={index}
                title={project.title}
                description={project.description}
                link={project.link}
              />
            ))}
          </div>
        </section>
        <section id="resume">
          <h2>Resume</h2>
          <Resume />
        </section>
        <section id="contact">
          <h2>Contact Me</h2>
          <ContactForm />
        </section>
      </main>
      <footer>
        <p>© 2025 [Your Name]. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
